export default function Divisores(){
  console.log("Hola desde divisores");

  let i = 0

  for (i = 1; i <= 10; i++){
    if (i % 2 == 0){
      console.log(i)
    }
    let pares=i
  }

  const [mostrar, setMostrar] = useState(0);
  const [pares, setPares] = useState(0);

return(
  <div>
    <h1>Divisores</h1>
    <div>
      <button onClick={() => setMostrar(!mostrar)}> Mostrar </button>
    {
      mostrar
      ? <h1> {} </h1>
      : <h1> 3,5,7 </h1>
    }
    </div>
  <button onClick={()=> setPares(pares)}> Pares </button>
    {
      pares
      ?"hola"
      :"pan"
    }
  </div>
)}
